INSERT INTO `yerlerin_bilgileri` (`id`, `id2`, `bilgi`, `x`) VALUES
(1, 1, 'istanbul Bogazinin Marmara Denizine yakin kisminda Salacak aciklarinda bulunan kucuk adacik uzerine yapilmis bir yapidir. uskudar\'in simgesi olan kule uskudar da Bizans\'tan kalan tek eserdir.Tarihte zaman zaman gozetleme kulesi, deniz feneri gibi amaclarla kullanilmis ve yillardir istanbul\'un sembollerinden biri olmuştur. Bugun gorulen kulenin temelleri ve alt katin onemli kisimlari Fatih devri yapisidir', 1),
(1, 2, 'Banisi Fatih Sultan Mehmet olan yapi 1462  1470 yillari arasinda mimar Atik Sinan\'a yaptirilmistir. Kulliye olarak tasarlanan yapida medrese, darussifa, tabhane, asevi, kutuphane, hamam ve cami bulunur. Yapinın insasinda secilen alanin onemi buyuktur. Bizans doneminde burada Hagioi Apostoloi Kilisesinin oldugu bilinir. Kulliyenin insasi icinde bu noktanin secilmis olmasi burada yeni bir inancin hakim oldugunu simgelemektedir. Bu yapilar toplulugu tam bir simetriye gore yapilmiştir. Kulliyenin ortasinda camiinin bulunmasi sehrin en onemli dini ve kulturel merkezini olusturur. Yapinin cevresindeki birimler dogru bir bicimde korunamadigindan ve 1509, 1557, 1754 ile son olarak yikildigi 1766 depreminden sonra gecirdigi hasarlar sonucunda topluca gunumuze ulasamamistir. Sultan III. Mustafa\'nin emriyle yaptirilan bugunku Fatih Camii, ozgunlugunu kaybetmis ve gunumuzdeki gorunumunu kazanmistir. ornegin, ilk yapiminda tek serefeli olan minareler bugun birer serefe daha eklenerek ve boylari uzatilarak, kulahlari da kursun kapli ahsaba cevirerek yapilarak yenilenmistir. ', 3),
(1, 3, 'Dunya mimarlik tarihinin gunumuze kadar ayakta kalmis en onemli anitlari arasinda yer alan Ayasofya; mimarisi, ihtisami, buyuklugu ve islevselligi yonunden sanat dunyasi acisindan onemli bir yer teskil etmektedir.\r\n\r\nAyasofya Dogu Roma İmparatorlugunun İstanbulda yapmis oldugu en buyuk kilise olup ayni yerde uc kez insa edilmistir. ilk yapildiginda Megale Ekklesia (Buyuk Kilise) olarak adlandirilmis, 5. yuzyildan itibaren ise Ayasofya (Kutsal Bilgelik) olarak tanimlanmistir. Ayasofya Dogu Roma imparatorlugu boyunca hukumdarlarin tac giydigi, baskentin en buyuk kilisesi olarak katedral islevi gormustur.\r\n\r\nBirinci kilise, imparator Konstantios (337-361) tarafindan 360 yilinda yapilmistir\r\n', 4),
(2, 1, 'Bursa Kalesinin, yapiminda cesitli blok ve moloz taslar kullanilmistir ve oldukca yuksek bir kaledir. Surlarinin 5 kapisi bulunan Bursa surlarinda Pinarbası Kapi ile Zindan Kapi arasindaki on surlar, evler arasinda kaybolmustur. Bunlarin arasinda yer alan Hisar Kapi 1855 yilindaki depremde yikilmistir', 5),
(2, 2, 'TURKIYENIN iLK TELEFERIGI Bursada Teleferik ve Telesiyej isletmesinin kurulusu, isletmenin acilisi ve tesislerin yapim isi 1958yilinda isvicreli Von Roll firmasina 27 milyon liraya ihale edilmis ve isletme 29 Ekim 1963 tarihinde tamamlanarak faaliyete gecmistir. Tesis iki kisimdan meydana gelmekteydi', 6),
(2, 3, 'Yildirim Bayezidin oglu celebi Sultan Mehmet tarafindan Yesil Cami ile birlikte 1421 yilinda yaptirilmistir. Turbe kentin dogusunda Yesil semtinde, Yesil Caminin karsisindaki tepe uzerindedir. Mimari Haci ivaz Pasa dir. Nakkaslari Ali bin ilyas Ali, Mehmed el Mecnun dur. Turk mezar anitlarinin en gosterislilerinden biri olan Yesil Turbe ismi ile ismi ile bilinen turbenin yapimi celebi Sultan Mehmetin olumunden kirk gun once h.824 (1421) yilinda bitirilmistir. ', 7),
(3, 1, 'Efes Antik Kenti\'nin en onemli kalintilarindan biridir Trajan Cesmesi. Antik kentteki Hadrian Tapinaginin biraz ilerisinde bulunan Efes Trajan Cesmesi, iki katli bir yapiya sahip. \r\n\r\nCesme buyuk bir havuzu uc tarafindan da cevrelemekte olup, suyun aktigi bolumde Imparator Trajan\'in bir heykeli yer alir. Sadece Imparatorun heykeli degil, bircok heykel bulunuyordu Trajan Cesmesi\'nde. Heykellerin cogu gunumuzde Efes Muzesi\'nde sergileniyor. \r\n\r\nEfes Antik Sehri\'nin goze carpan kalintilarindan biri de Kuretler Caddesidir. Bu eski yerlesim alani onemli kalintilariyla farkli bir zaman dilimine goturecek sizleri.\r\n', 8),
(3, 2, 'Halk arasinda Aziz Yahya Kilisesi olarak da anilan Saint John Kilisesi, Selcuk Kalesinin bulundugu tepenin guneyinde yer almakta olup Efesteki Bizans Donemi yapilarinin en gorkemlisidir.\r\n \r\nIsa Peygamberin annesi Hazreti Meryemi Kudusten Efese getiren ve Incili yazan Saint Johnun mezarinin bulundugu kilisenin avlusundaki terastan, Artemis Tapinagi, Isa Bey Camisi ve Ege Denizine kadar uzanan alan panoramik olarak seyredilebilir.\r\n \r\nKilisenin bulundugu bolge, yapilan kazi ve restorasyon calismalari ile 14. yuzyilda kilisenin yakinina insa edilen Isa Bey Camisinden sonra cok daha onem kazanmis, ziyaretcilerin ugrak yeri olmustur.\r\n', 9),
(3, 3, 'Hisar Camisi, 1592 yilinda Yakup Bey tarafindan yaptirilmistir. Izmirin en buyuk ve gosterisli camisidir. Merkezi bir kubbe ve bunun etrafinda yer alan kucuk kubbelerle ortulu bir harim mekani (ibadet edilen asil mekan) ile kubbeli bir son cemaat yerinden olusmaktadir.\r\nYenilenen minaresi ile cami, klasik donem Osmanli camilerinin tipik ozelliklerini tasimaktadir. Cami icindeki kalem isi suslemeleri, hat sanatinin inceliklerinin sergilendigi panolar ve mihrap-minber isciligi Turk sanat zevkinin en iyi orneklerindendir. Cami 1813, 1881, 1927 ve 1980li yillarda onarim gormustur.\r\nKaynak: Izmir Il Kultur ve Turizm Mudurlugu\r\n\r\nGoruslerinizi Yazin\r\n\r\n', 10),
(4, 1, 'Selcuklu Veziri Sahip Ata Fahreddin Ali tarafindan hadis ilmi okutulmak uzere(Hicri 663) 1254 yilinda yaptirilmistir. Mimari Abdullah oglu Keluktur Selcuklu tas isciligi saheserlerinden olan tac kapisi uzerinde kabartmali geometrik ve bitkisel bezemelerle birlikte Selcuklu sulusuyle yazilmis  Yasin ve Fetih sureleri vardir binanin ic mekanlari avlu, eyvan dershane ve orgenci hucrelerinden olusur. Minare kaidesi kesme tasla kapli tugla malzeme kullanilarak yapilmis ve on cephede akant yapragi ile bezelidir yari piramit formlu ucgenle ve 12 koseli, govde koseli turkuaz mavi sirli tugladan yapilmis cift serefelidir. 1901 de yildirim dusmesiyle birinci serefeye kadar yikilmistir. 1956 yilinda muze olarak acilmis olup Selcuklu , beylikler ve Osmanli donemine ait tas ve ahsap eserler teshir edilmektedir.', 11),
(4, 2, '	Kurucusu : Sultan Ikinci Selim\r\n	Mimari : Koca Sinan\r\n	Yapilis Tarihi : 1568 ila 1574\r\n	Kapladigi Yer : Kulliye ile birlikte 22.202 m2\r\n	Caminin Ici : 1620 m2\r\n	Caminin Haremi : 2475 2\r\n	Kubbenin Capi : 31.30 m.\r\n	Yerden Kubbenin Kilit Tasina olan yuksekligi : 43.28 m.\r\n	Minarelerin Yuksekligi : 70.89 m. ya da 72.50 m.\r\n', 12),
(4, 3, 'Konya ilinin Hadim ilcesinde yer alan Yerkopru Selalesi diger adi ile Goksu Selalesi ilginc jeolojik yapisi ile on plana cikmaktadir.\r\nHadim ilce merkezine 23 kilometre uzaklikta bulunan Yerkopru Selalesi Anadolu topraklarindaki onemli nehirlerden biri olan Goksu Nehri Yerkoprude bulunan magaranin icine giriyor ve burada kayboluyor. Bolgedeki bir diger akarsu olan Karasu Cayi, Goksu Nehrinin yaklasik 25 metre uzerinde aktiktan sonra Yerkopru Selalesini olusturuyor. 15- 20 metre yukseklikten dokulen Yerkopru Selalesi muhtesem bir guzellik olusturmaktadir. Yerkopru Selalesinin cevresinde piknik alanlari bulunmaktadir.\r\n', 13);

